import React from 'react';
import styled from "styled-components";
import PropTypes from 'prop-types';

const ButtonItem = styled.button`
  /* Rectangle */

  position: absolute;
  width: 152px;
  height: 30px;
  left: 316px;
  top: 250px;

  background: #39C071;
  border-radius: 3px;

`

const Button = ({ children }) => {
    return (
        <ButtonItem>{children}</ButtonItem>
    );
};

export default Button;
